import React, { useState } from 'react';
import './CategoryList.css';

const AddProduct = () => {
    const [formData, setFormData] = useState({
        itemName: '',
        quantity: '',
        unit: '', // Updated to handle unit as a select option
        productDetails: '',
        refillDate: '',
        status: '', // Updated to handle status as a select option
        notes: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle form submission logic here
        console.log('Product Data Submitted:', formData);
    };

    return (
        <div className="add-product-page">
            <h1 className="add-product-title">Add Product</h1>
            <div className="table-container">
                <form onSubmit={handleSubmit}>
                    <table>
                        <thead>
                            <tr>
                                <th>Item Name</th>
                                <th>Quantity</th>
                                <th>Unit</th>
                                <th>Product Details</th>
                                <th>Refill Date</th>
                                <th>Status</th>
                                <th>Notes</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td><input type="text" name="itemName" value={formData.itemName} onChange={handleChange} required /></td>
                                <td><input type="number" name="quantity" value={formData.quantity} onChange={handleChange} required /></td>
                                <td>
                                    <select name="unit" value={formData.unit} onChange={handleChange} required>
                                        <option value="">Select Unit</option>
                                        <option value="kg">Kg</option>
                                        <option value="g">Gram</option>
                                        <option value="piece">Piece</option>
                                    </select>
                                </td>
                                <td><textarea name="productDetails" value={formData.productDetails} onChange={handleChange} required></textarea></td>
                                <td><input type="date" name="refillDate" value={formData.refillDate} onChange={handleChange} required /></td>
                                <td>
                                    <select name="status" value={formData.status} onChange={handleChange} required>
                                        <option value="">Select Status</option>
                                        <option value="Available">Available</option>
                                        <option value="Out of Stock">Out of Stock</option>
                                        <option value="Pending">Pending</option>
                                    </select>
                                </td>
                                <td><textarea name="notes" value={formData.notes} onChange={handleChange}></textarea></td>
                            </tr>
                        </tbody>
                    </table>
                    <button type="submit">Submit</button>
                </form>
            </div>
        </div>
    );
};

export default AddProduct;
